        /// <summary>Returns the I32x2 element at a specified index.</summary>
        unsafe public ref I32x2 this[int index]
        {
            get
            {
#if ENABLE_UNITY_COLLECTIONS_CHECKS
                if ((uint)index >= 2)
                    throw new System.ArgumentException("index must be between[0...1]");
#endif
                fixed (I32x2x2* array = &this) { return ref ((I32x2*)array)[index]; }
            }
        }

