        /// <summary>Return the I32x2x2 transpose of a I32x2x2 matrix.</summary>
        /// <param name="v">Value to transpose.</param>
        /// <returns>Transposed value.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static I32x2x2 transpose(I32x2x2 v)
        {
            return new I32x2x2(
                v.c0.x, v.c0.y,
                v.c1.x, v.c1.y);
        }

        /// <summary>Returns the determinant of a I32x2x2 matrix.</summary>
        /// <param name="m">Matrix to use when computing determinant.</param>
        /// <returns>The determinant of the matrix.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static int determinant(I32x2x2 m)
        {
            int a = m.c0.x;
            int b = m.c1.x;
            int c = m.c0.y;
            int d = m.c1.y;

            return a * d - b * c;
        }

        /// <summary>Returns a uint hash code of a I32x2x2 matrix.</summary>
        /// <param name="v">Matrix value to hash.</param>
        /// <returns>uint hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint hash(I32x2x2 v)
        {
            return csum(x:
                    AsU32(v.c0) * new U32x2(0xE191B035u, 0x68586FAFu) +
                    AsU32(v.c1) * new U32x2(0xD4DFF6D3u, 0xCB634F4Du)) + 0x9B13B92Du;
        }

