        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static U32x2 hashwide(I32x2x2 v)
        {
            return (AsU32(v.c0) * new U32x2(0x4ABF0813u, 0x86068063u) +
                    AsU32(v.c1) * new U32x2(0xD75513F9u, 0x5AB3E8CDu)) + 0x676E8407u;
